import React from 'react';
import './App.css';

import Form from './components/Form';
import Title from './components/Title';
import Weather from './components/Weather';

class App extends React.Component{
  render(){
    return(
      <div>
        <Title />
        <Form />
        <Weather />

      </div>
    );
  }

}



export default App;
